                     baseURL: "http://localhost:5000/api/juegos",
                     withCredentials: true // RUTAS PERSISTENTES
                   });
                 }

                 bonoloto = bonoloto =>
                   this._service.post("/bonoloto", bonoloto);
                 getbonoloto = bonoloto =>
                   this._service.get("/bonoloto", bonoloto);
                 primitiva = primitiva =>
                   this._service.post("/primitiva", primitiva);
                 getprimitiva = primitiva =>
                   this._service.get("/primitiva", primitiva);
                 gordo = gordo => this._service.post("/gordo", gordo);
                 getgordo = gordo => this._service.get("/gordo", gordo);
                 euromillon = euromillon =>
